import React, { Component }  from 'react';

class Home extends Component {
 render(){
   return (
    <div className='home'>
      <h1>Home</h1>
      <div class="card">
            <div class="card-body">
              <h5 class="card-title">Steve Jobs</h5>
              <h6 class="card-subtitle mb-2 text-muted">steve@apple.com</h6>
              <p class="card-text">Stay Hungry, Stay Foolish</p>
            </div>
     </div>
    </div>
  );
 }
  
}

export default Home;
